export default function Welcome() {
    return (
        <div className="flex items-center min-h-screen">
            <div id="welcome" className="mx-10">
                <div id="intro">
                    <h1 className="gradient-text font-bold text-4xl">Hey there, RRISD student!</h1>
                    <p className="text-white min-w-60 w-5/12">Congratulations, you're about to be a high schooler! Before you transition, it is vital to understand what your passion is and how you will move forward with our career. We're going to do something called a <b>four year plan</b>.</p>
                    <a href="/four-year-plan-breakdown"><button></button></a>
                </div>
            </div>
        </div>
    );
}
